import "./App.css";
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";

function App() {
  return (
    <div className="App"
    style ={{
      height: '200vh'
    }}
    >
      <Navbar 
      bg="light"
      style= {{
        border : '1px solid',
        height : '90px',
        position: 'fixed',
        width: "100%",
        display: 'flex',
        justifyContent: 'space-between',
        padding: '0 8%'
      }} 
      variant="light"
      >
        <div>
        <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        </div>
        <div>
        <Nav className="me-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#features">neigbor</Nav.Link>
        </Nav>
        </div>
      </Navbar>
    </div>
  );
}

export default App;
